import React, { useEffect } from 'react';
import gsap from 'gsap';
import './style.css'; // Include the updated CSS file

const MoroccanArtisanPage = () => {
  useEffect(() => {
    // Animate navbar links
    gsap.from(".nav-links a", {
      opacity: 0,
      x: -50,
      stagger: 0.2,
      duration: 1,
    });

    // Animate auth buttons
    gsap.from(".auth-buttons button", {
      opacity: 0,
      y: 20,
      stagger: 0.3,
      duration: 1,
    });

    // Animate hero section heading
    gsap.from(".hero-section h1", {
      opacity: 0,
      y: 50,
      duration: 1.5,
    });

    // Animate hero section subheading
    gsap.from(".hero-section h2", {
      opacity: 0,
      y: 30,
      duration: 1,
    });

    // Animate CTA button
    gsap.from(".cta-button", {
      opacity: 0,
      y: 30,
      duration: 1,
    });
  }, []);

  return (
    <div className="container">
      {/* Navbar */}
      <nav className="navbar">
        <div className="nav-links">
          <a href="#home">Home</a>
          <a href="#shop">Shop</a>
          <a href="#artisans">Artisans</a>
          <a href="#about">About</a>
          <a href="#contact">Contact</a>
        </div>
        <div className="auth-buttons">
          <button className="login-button">Log In</button>
          <button className="signup-button">Sign Up</button>
        </div>
      </nav>

      {/* Hero Section */}
      <div className="hero-section">
        <h2>Tradition Meets Innovation</h2>
        <h1>Discover Moroccan <br /> Artisan Excellence</h1>
        <button className="cta-button">Learn About Artisan</button>
      </div>
    </div>
  );
};

export default MoroccanArtisanPage;
